from __future__ import annotations

import dataclasses
import datetime
import json
import logging
import os
import sys
import time
import urllib.parse
from pathlib import Path
from typing import List, Optional

import pandas as pd
import streamlit as st
import streamlit.components.v1 as components
import vertexai

import retrieval
from constants import (
    MAX_OUTPUT_TOKENS,
    PROMPT_TEMPLATE,
    SCORE_THRESHOLD,
    TEMPERATURE,
    TOP_DOCUMENTS,
    TOP_K,
    TOP_P,
)

# add credential: https://cloud.google.com/docs/authentication/troubleshoot-adc#user-creds-client-based
PROJECT_ID = os.environ["GCLOUD_PROJECT_ID"]
LOCATION = "europe-west2"  # e.g. us-central1
vertexai.init(project=PROJECT_ID, location=LOCATION)

stream_handler = logging.StreamHandler(sys.stdout)
stream_handler.level = logging.INFO
logging.basicConfig(
    format="%(asctime)s - %(message)s", level=logging.INFO, handlers=[stream_handler]
)


def gcp_storage_link(filename: str, bucket: Optional[str] = None):
    bucket = bucket or os.getenv("BUCKET_NAME")
    return f"https://storage.googleapis.com/{bucket}/{urllib.parse.quote(filename)}"


@dataclasses.dataclass
class Question:
    content: str
    timestamp: datetime.datetime = dataclasses.field(
        default_factory=lambda: datetime.datetime.utcnow()
    )


@dataclasses.dataclass
class SourceDocument:
    file: str
    page_number: int
    page_content: str


@dataclasses.dataclass
class Answer:
    content: str
    docs: List[SourceDocument]
    timestamp: datetime.datetime = dataclasses.field(
        default_factory=lambda: datetime.datetime.utcnow()
    )


st.set_page_config(
    page_title="Knowledge Management Demo",
    page_icon=":magic_wand:",
    layout="centered",
    menu_items={
        "Get Help": "https://www.extremelycoolapp.com/help",
        "Report a bug": "https://www.extremelycoolapp.com/bug",
        "About": "# This is a header. This is an *extremely* cool app!",
    },
)

components.html(
    """
<div style="display:flex;gap:30px;align-items: center">
  <div style="max-width:150px">
    <img style="width: 100%;  aspect-ratio: 1/1" src="data:image/jpeg;base64,"/>
</div>
  <h1 style='flex:1;font-family:"Source Sans Pro", sans-serif;font-weight: 700;color:rgb(49, 51, 63);font-size:calc(1.4rem + 1.8vw)'>Knowledge Management</h1>
</div>
"""
)

ss = st.session_state
ss.question = ss.get("question")
ss.answer = ss.get("answer")


@st.cache_resource
def get_cached_qa(kwargs):
    qa = retrieval.get_qa(**kwargs)
    return qa


ss.arguments = ss.get(
    "arguments",
    {
        "temperature": TEMPERATURE,
        "max_output_tokens": MAX_OUTPUT_TOKENS,
        "top_p": TOP_P,
        "top_k": TOP_K,
        "prompt_template": PROMPT_TEMPLATE,
        "score_threshold": SCORE_THRESHOLD,
        "top_num_retrieve_doc": TOP_DOCUMENTS,
    },
)

with st.sidebar:
    st.subheader("Configuration")
    with st.form("my_form"):
        st.write("**Model Parameters**")
        temperature = st.slider(
            "temperature",
            0.0,
            1.0,
            ss.arguments["temperature"],
            0.01,
            help="The higher the more creative response",
        )
        max_output_tokens = st.slider(
            "max_output_tokens",
            0,
            1024,
            ss.arguments["max_output_tokens"],
            1,
            help="A higher value for longer response",
        )
        top_k = st.slider(
            "top_k",
            0,
            40,
            ss.arguments["top_k"],
            1,
            help="A higher value for more random responses",
        )
        top_p = st.slider(
            "top_p",
            0.0,
            1.0,
            ss.arguments["top_p"],
            0.01,
            help="A higher value results in more diverse and interesting outputs",
        )

        st.write("**Document Retriever Requirement**")
        score_threshold = st.slider(
            "score_threshold",
            0.0,
            1.0,
            ss.arguments["score_threshold"],
            0.01,
            help="Filter the relevant document, the higher the better",
        )
        top_num_retrieve_doc = st.slider(
            "num of the top retrieve docs",
            1,
            5,
            ss.arguments["top_num_retrieve_doc"],
            1,
            help="The number of the top retrieve documents",
        )

        prompt_template = st.text_area(
            "**Prompt Template**", value=ss.arguments["prompt_template"], height=150
        )

        # Every form must have a submit button.
        submitted = st.form_submit_button("Submit")
        if submitted:
            ss.arguments = {
                "temperature": temperature,
                "max_output_tokens": max_output_tokens,
                "top_p": top_p,
                "top_k": top_k,
                "prompt_template": prompt_template,
                "top_num_retrieve_doc": top_num_retrieve_doc,
                "score_threshold": score_threshold,
            }

with st.spinner("Loading..."):
    qa = get_cached_qa(ss.arguments)

st.subheader("Question")
ss.raw_query_text = st.text_area(
    "question",
    value=ss.get("raw_query_text", ""),
    height=100,
    placeholder="Enter question here",
    help="",
    label_visibility="collapsed",
)

if ss.question and ss.raw_query_text.strip() != ss.question.content:
    ss.answer = None

if st.button("Get answer", type="primary"):
    ss.question = Question(ss.raw_query_text.strip())
    ss.answer = None

    with st.spinner("Getting answer..."):
        time.sleep(3)
        response = qa(ss.question.content)

    answer, docs = response["result"], response["source_documents"]
    ss.answer = Answer(
        answer,
        [
            SourceDocument(
                doc.metadata["source"], doc.metadata["page"], doc.page_content
            )
            for doc in docs
        ],
    )

if ss.answer:
    with st.container():
        st.subheader("Answer")
        st.write(ss.answer.content)

        st.subheader("Source Documents")
        for i, doc in enumerate(ss.answer.docs, 1):
            file_path = Path(doc.file)
            with st.expander(f"#{i} {file_path.name} (page {doc.page_number + 1})"):
                # st.markdown(f"{i}. {doc.file} (page {doc.page_number})")
                # use the file names which were captured when processed as local files
                st.markdown(f"[Download File]({gcp_storage_link(file_path.name)})")
                # st.download_button(
                #     label="Download File",
                #     data=file_path.read_bytes(),
                #     file_name=file_path.name,
                #     key=i
                # )
                st.markdown(doc.page_content)

    _, col1, col2 = st.columns([2, 1, 1])

    with col1:
        st.download_button(
            label="Download JSON",
            data=json.dumps(
                {
                    "question": ss.question.content,
                    "answer": ss.answer.content,
                    "source_docs": [
                        dataclasses.asdict(
                            SourceDocument(d.file, d.page_number + 1, d.page_content)
                        )
                        for d in ss.answer.docs
                    ],
                },
                indent=4,
            ),
        )

    with col2:
        st.download_button(
            label="Download CSV",
            data=pd.DataFrame(
                data=[
                    {
                        "question": ss.question.content,
                        "answer": ss.answer.content,
                        "source_docs": json.dumps(
                            [
                                dataclasses.asdict(
                                    SourceDocument(
                                        d.file, d.page_number + 1, d.page_content
                                    )
                                )
                                for d in ss.answer.docs
                            ],
                            indent=2,
                        ),
                    }
                ]
            ).to_csv(index=False),
            file_name="output.csv",
            mime="text/csv",
        )
